const Navbar = () => {
    return (
        <nav className="navbar">
            <h1>MINI TURBO DERBY</h1>
            <div>
                <a href="/track">Track</a>
                <a href="/garage">Garage</a>
                <a href="/bank">Bank</a>
                <a href="/howtoplay">How to play!</a>
                <a href="/credits">Credits</a>
            </div>
        </nav>
    );
}
 
export default Navbar;
